'use strict';const {PrismaClient}=require("./app/generated/prisma/client"),prisma=new PrismaClient;
async function main(){try{console.log("Checking database...");const a=await prisma.users.findMany({select:{id:!0,email:!0,name:!0}});console.log("Users:",a);const b=await prisma.persons.findMany({select:{id:!0,first_name:!0,last_name:!0,userId:!0}});console.log("Persons:",b);const c=await prisma.events.findMany({select:{id:!0,title:!0,userId:!0}});console.log("Events:",c)}catch(a){console.error("Error:",a)}finally{await prisma.$disconnect()}}main();